import React,{Component} from 'react'

class Listemployee extends Component {
    constructor(props) {
        super(props);
        this.state = { employee:[] }

    }

    componentDidMount(){
        let empdata = window.localStorage.getItem("employee")

      setState({employee:JSON.parse(empdata)})
    }

    render() { 
        return ( 

            <div>
                <table className="table">
                    <thead>
                        <tr>
                            <th scope="col">Sr</th>
                            <th scope="col">Images</th>
                            <th scope="col">Full Name</th>
                            <th scope="col">DOB</th>
                            <th scope="col">Designation</th>
                            <th scope="col">Experience</th>
                            <th scope="col">Action</th>

                        </tr>
                    </thead>

                    <tbody>
                        {employee && employee.map((d,i)=>

                                <tr key={i}>
                                    <th scope="row">{i+1}</th>
                                    <th scope="col"><img height="100" width="100" src={d.photo} /></th>
                                    <th scope="col">{d.firstname+' '+d.lastname}</th>
                                    <th scope="col">{d.dob}</th>
                                    <th scope="col">{d.experience}</th>
                                    <th scope="col">{d.ex}</th>
                                    <th scope="col"><a href="#" className="btn btn-success">Edit</a> || <a href="#" className="btn btn-warning">delete</a></th>
                                </tr>
                        )}

                    </tbody>

                </table>
            </div>
         );
    }
}

export default Listemployee;
